import React from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();

  const logout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <header
      style={{
        padding: "10px",
        background: "#2563eb",
        color: "#fff",
        display: "flex",
        justifyContent: "space-between",
      }}
    >
      <h2>Astrape üõç</h2>
      <div>
        <Link style={{ margin: "0 10px", color: "#fff" }} to="/items">
          Items
        </Link>
        <Link style={{ margin: "0 10px", color: "#fff" }} to="/cart">
          Cart
        </Link>
        <button
          onClick={logout}
          style={{ marginLeft: "10px", padding: "5px 10px" }}
        >
          Logout
        </button>
      </div>
    </header>
  );
}
